(137, 1, '2020-09-22 17:53:29', '2020-09-22 14:53:29', '<fieldset>\r\n<div class=\"half\">\r\n    <label>Name <span class=\"required\">*</span>[text* contactName id:contactName]</label>\r\n  </div>\r\n <div class=\"half pull-right\">\r\n    <label>Email <span class=\"required\">*</span>[email* contactEmail id:contactEmail]</label>\r\n  </div>\r\n<div>\r\n    <label>Subject[text contactSubject id:contactSubject]</label>\r\n  </div>\r\n<div>\r\n    <label>Message <span class=\"required\">*</span>[textarea* contactMessage id:contactMessage]</label>\r\n  </div>\r\n<div>\r\n      [submit class:submit \"Submit\"]\r\n<span id=\"image-loader\">\r\n   <img src=\"images/loader.gif\" alt=\"\" />\r\n</span>\r\n  </div>\r\n</fieldset>\n1\nSparrow \"[your-subject]\"\nSparrow <wordpress@sparrow>\ntest@mail.ru\nОт: [your-name] <[your-email]>\r\nТема: [your-subject]\r\n\r\nСообщение:\r\n[your-message]\r\n\r\n-- \r\nЭто сообщение отправлено с сайта Sparrow (http://sparrow)\nReply-To: [your-email]\n\n\n\n\nSparrow \"[your-subject]\"\nSparrow <wordpress@sparrow>\n[your-email]\nСообщение:\r\n[your-message]\r\n\r\n-- \r\nЭто сообщение отправлено с сайта Sparrow (http://sparrow)\nReply-To: test@mail.ru\n\n\n\nСпасибо за Ваше сообщение. Оно успешно отправлено.\nПри отправке сообщения произошла ошибка. Пожалуйста, попробуйте ещё раз позже.\nОдно или несколько полей содержат ошибочные данные. Пожалуйста, проверьте их и попробуйте ещё раз.\nПри отправке сообщения произошла ошибка. Пожалуйста, попробуйте ещё раз позже.\nВы должны принять условия и положения перед отправкой вашего сообщения.\nПоле обязательно для заполнения.\nПоле слишком длинное.\nПоле слишком короткое.\nФормат даты некорректен.\nВведённая дата слишком далеко в прошлом.\nВведённая дата слишком далеко в будущем.\nПри загрузке файла произошла неизвестная ошибка.\nВам не разрешено загружать файлы этого типа.\nФайл слишком большой.\nПри загрузке файла произошла ошибка.\nФормат числа некорректен.\nЧисло меньше минимально допустимого.\nЧисло больше максимально допустимого.\nНеверный ответ на проверочный вопрос.\nНеверно введён электронный адрес.\nВведён некорректный URL адрес.\nВведён некорректный телефонный номер.', 'Контактная форма 1', '', 'publish', 'closed', 'closed', '', '%d0%ba%d0%be%d0%bd%d1%82%d0%b0%d0%ba%d1%82%d0%bd%d0%b0%d1%8f-%d1%84%d0%be%d1%80%d0%bc%d0%b0-1', '', '', '2020-09-22 18:21:35', '2020-09-22 15:21:35', '', 0, 'http://sparrow/?post_type=wpcf7_contact_form&#038;p=137', 0, 'wpcf7_contact_form', '', 0),
